Question: What will be output of the following C code?
#include <stdio.h>
int main()
{
    int x=4, y, z;
    y = --x;
    z = x--;
    printf("%d, %d, %d\n", x, y, z);
    return 0;
}

Question: What will be output of the following C code?
#include <stdio.h>
main()
{
    int a=1, b=3;
    b= a++ + a++ + a++ + a++ + a++;
    printf("a=%d \n b=%d",a,b);
}

Question: What will be output of the following C code?
#include <stdio.h>
main()
{
    int a=9, b=9;
    a=b++;
    b=a++;
    b=++b;
    printf("%d %d",a,b);
}

Question: What will be output of the following C code?
#include <stdio.h>
main()
{
     int a,b;
     b = 10;
     a = ++b + ++b;
     printf("%d%d",a,b);
}

Question: Select the output for following set of code.
static void Main(string[] args)
{
    int i = 2, j = 4;
    switch (i + j * 2)
    {
        case 1 :
        case 2 :
            Console.WriteLine("1 and 2");
            break;
        case 3 to 10:
            Console.WriteLine("3 to 10");
            break;
    }
    Console.ReadLine();
}

Question: Select output for following set of code.
static void Main(string[] args)
{
     int const p = 0;
     switch (3 * 5 / 6)
     {
         case p:
             Console.WriteLine("A");
             break;
         case p * 1:
             Console.WriteLine("B");
             break;
         case p - 2:
             Console.WriteLine("C");
             break;
         default:
             Console.WriteLine("D");
       }
}

Question: Select output for following set of code.
static void Main(string[] args)
{
    int i = 2, j = 3, k = 4;
    switch (i + j - k)
    {
        case 0: case 2: case 4:
            ++i;
            k += j;
            break;
        case 1: case 3: case 5 :
            --i;
            k -= j;
            break;
        default:
            i += j;
            break;
     }
     Console.WriteLine(i + "\n" + j + "\n" + k);
     Console.ReadLine();
}
